■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">ダイワ グローブライド モアザン スライ 95F DAIWA MORETHAN SLY 95F / ソルトルアー ミノー<br /><br />大野ゆうき監修。水面直下の秘密に迫る魅惑のシャローランナー <br /> <br />重心移動システムを採用していながら素早い立ち上がり！<br />あらゆる条件下で水面直下を安定キープ！<br />魚の興味を最大限に引き出す波間に揺れるアクションと水平姿勢！<br /> <br />細身で小柄なフローティングミノーでありながら、重心移動ウエイトを採用することにより広い射程距離を確保し、なおかつ素早い立ち上がりを実現。水面付近に浮くバチやハク、また他の小魚を強く意識したシーバスに強い興味を抱かせ、最後までエサと信じこませ深いバイトへと誘うため、波間に揺れる絶妙なアクションと喫水・水平姿勢のバランスを最大限に追求。リトリーブスピードを変えたりルアーに当たる水流が強くなったりしても大きくレンジを変えることなく、水面直下を安定してキープしながら引くことや流すことができるのも魅力。<br /><br />■発売年：2017年</font></td></tr></table><STYLE type="text/css">
